INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (205,'049','많은 사람들 위에 군림하며 이름과 명성을 떨리게 될 것입니다. 재산과 의복이 풍부하니 내신이 편화롭고 부귀를 누리게 될 것입니다. 명리가 다 길하니 이름이 더욱 빛나게 될 것입니다. 이익이 타향에 있을 것이니 출타하면 얻게 될 것입니다.','해와 나무가 봄철을 만났으니 꽃과 나무가 무성하여 현란 쌍을 이룬 것과 같이 집안이 화평하고 쾌하에 영화로움이 있을 것이니 필시 서로 이해하는 데서 온 것입니다. 가정이 날로 왕성해 짐 것이니 모두 이익이 화목함에 있습니다.','작은 용이 하늘로 올라오니 드디어 띠를 이루었습이며 높이 큰비를 내려주니 그 은혜가 끝기만 합니다. 만약 결과이 아니라면 도리어 흉하게 화로 변할 것이니 주의하십시오. 만약 공명하면 이름이 사회로 떨치게 될 것입니다.','재물을 혹은 모으고 혹은 흩어지게 될 것이니 모을 때를 잘 지켜야 합니다. 다른 사람의 말을 잘 못 듣게 되면 기쁨과 금심이 반반일 것입니다. 주장을 잘 지키십시오. 재성이 목에 따르게 되었으니 띠맵의 후회를 할 운수입니다.','심신이 화평하니 이름이 높고 뜻깊이 넓어 사람들에게 은혜를 베풀게 되겠습니다. 만약 후회가 아니라면 가히 공명을 얻을 것이니 둘 다 좋은 운수입니다. 때를 맞추고 행기로우니 필시 쾌하에 경사가 있을 것이며 좋은 작치를 바이게 될 것입니다.','서쪽 사람에게는 일의 내용을 말해서는 안되니 일을 마무리 지으려면 비밀리에 하십시오. 길한 사람은 정직과 긴질이니 사람 사귀기를 성실 성의껏 해야 합니다. 사방이 불리하니 함부로 실행하지 마십시오. 일을 너무 서둘러 마무리 지으려서는 안됩니다.','날이 따뜻한 봄날에 만물이 다시 소생하듯 그 즐거움이 더 휘영 넘치게 됩니다. 차고 더운 것이 다 차례가 있으니 필시 성공을 거두게 될 짐조가 아니겠습니까. 동방에 해가 있으니 그 곳을 가까이 하지 마십시오. 그 방향으로 일을 시작했다가는 해로우니 잠시 중단하십시오.','하는 일이 많아서 분주해짐 것입니다. 영맹수이 문을 지켰으니 다른 곳에 가야 이익을 얻을 것입니다. 그러나 너무 많이 벌여서 바쁘기만 하면 실속이 별로 없습니다. 도처에 재물이 있으니 마음이 기쁘고 편화로울 것입니다. 좋은 일을 곧라서 덤비십시오.','집안 사람의 마음이 한 결 같으니 소망을 모두 이루어 기쁨을 맞게 될 것입니다. 달 밝은 밤에 아름다운 사람을 만나게 되겠습니다. 식구가 늘어나고 영토가 늘어나니 가정이 날로 번창할 것입니다. 사람으로 인하여 기쁜 일이 있겠습니다.','양쪽이 서로 순조하여 합했으니 만물이 다시 살아나서 쌍을 이룬과 같습니다. 재산과 복력이 목에 따르니 기쁜 마음이 얼굴에 만연하여 감출 수가 없습니다. 사방에 길함이 있으니 이쪽으로 터를 옮기면 좋겠습니다. 일을 마무리 짓기에 적절한 운수입니다.','길한 가운데 왕성하니 반드시 좋은 일이 있을 것입니다. 관인이 왼쪽 도왔 줄 것이니 큰 재물을 가히 얻을 수 있겠습니다. 사람을 밉음으로 대해야만 복을 만나게 됩니다. 펼쾅을 모아 산이 되는 법이니 이런 자세로 임한다면 반드시 공을 세우게 될 것입니다.','즐기고 웃고자 말을 하니 늘늘 입을 가릴 수가 없을 만큼 즐겁겠습니다. 만약 시험에 합격하지 않는다면 부모에 금심거리가 생길 것이니 주의해야 합니다. 관인은 필시 서쪽과 남쪽에 있겠으니 성대하게 추진하고 과감하게 마무리를 지으십시오.','구름이 가고 비가 내려 초목을 적시우니 만물이 생동감에 넘치게 됩니다. 흉한 가운데 길함이 있으니 필시 형통하여 일이 문란치는 않겠습니다. 부부가 화목하니 기쁨이 가정에 가득하게 될 것입니다. 이 모두가 당신이 뜻을 베풀고 선행을 했기 때문입니다.','2025-03-02 11:57:41.395718+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (418,'049','它将统治许多人，并成为名字和名望。丰富的财产和衣服将得到安慰，并将被享受。这个名字都很长，因此名称将更加闪耀。利润将是在另一个方面，因此您外出时会得到它。','由于阳光和树遇到了春季，花朵和树木茂盛，房子的两对将来自彼此了解。这个家庭每天都会充满活力，所以每个人都处于和解。','小龙升起天空，所以终于实现了，这是一个大雨。如果不是结果，请小心，它会引起愤怒。如果您引起共鸣，您的名字将被颤抖到社会中。','它将收集或收集财富或分散，因此您需要保留何时收集。如果您听不到别人的话，快乐和运气将是一半。保持您的主张。由于财富之后是脖子，很幸运的是后悔蒂蒂地图。','因为身心很安静，所以名字很高且非常有意义，因此我们将为人们提供恩典。如果您不后悔，您将会引起共鸣，因此两者都很好运。它将在当时倾斜，这将是个好时机。','它不应告诉西方人工作的内容，因此要秘密完成工作。一个人是诚实而漫长的，所以你必须诚意出去。不要运行各个方面，因此请勿运行。不要赶紧太多。','欢乐散发出溢出，好像在温暖的春天，所有事物都复活了。这是所有热热的，所以这不是成功的指南。东部有阳光，所以不要到达那里。停止它一会儿，因为您开始朝这个方向工作。','很忙，因为有很多工作。由于我们保留了这扇门，我们将不得不去其他地方受益。但是，如果您忙碌而忙碌，那就不多了。到处都有财富，因此您会感到快乐和舒适。对了好事。','家庭的心脏就像结果一样，因此我们很乐意实现我们所有的愿望。我将在一个明亮的夜晚遇到一个美丽的人。随着家庭的成长和领土的增加，家庭将日复一日地蓬勃发展。由于人而有一件好事。','双方彼此结合在一起，因此所有事物都得到了复兴和配对。由于属性和力量取决于脖子，因此欢乐在脸上广泛存在，因此您无法将其隐藏。到处都有一段长度，所以我想移动这个地方。完成工作是一个合适的运气。','在路中间，会有一件好事。官员将左边走，这样您就可以获得大财富。您只需要对待人们才能满足祝福。这是一种收集不富人并成为山上的方法。','我告诉你享受和笑，所以我不能总是遮住嘴。如果您不通过考试，则应具有线性范围。官员必须在西方和南部，因此将其宣传并大胆完成。','随着云层的下雨，植被被浸透了，所以万物都很活跃。丑陋的中间有很长的路要走，所以我不会被打扰。由于这对夫妇很和谐，欢乐将充满家园。因为所有这一切都是您的意思，并做了良好的行为。','2025-03-02 11:57:41.395718+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (489,'049','それは多くの人々を支配し、名前と名声になります。財産と衣類が豊富に快適になり、楽しまれます。名前はすべて長いので、名前はさらに輝きます。利益はもう一方になるので、外出するとそれを手に入れます。','太陽と木が春の季節に会ったので、花と木は青々としており、家のペアのペアはお互いを理解することから来ます。家族は日々激しくなるので、誰もが和解しています。','小さなドラゴンが空に近づいているので、ついに達成され、大きな雨です。それが結果でない場合は、注意してください、それは怒りになります。共鳴すると、あなたの名前は社会に踏みにじられます。','それは富を収集または収集するか、散らばるので、いつ収集するかを維持する必要があります。他の人の言葉を聞くことができない場合、喜びと運は半分と半分になります。あなたの主張をうまく保ちます。富が首に続いているので、ティティマップを後悔することは幸運です。','心と体は平和であるため、名前は高く、非常に意味があるので、私たちは人々に恵みを与えます。あなたがそれを後悔しないなら、あなたは共鳴するので、両方とも幸運です。それは時代に傾斜し、良い時期になります。','それは西洋人に仕事の内容について話すべきではないので、仕事を終えるために密かにしてください。一人は正直で長いので、誠実に外出しなければなりません。すべての側面を走らないでください。そうすれば、実行しないでください。急いではいけません。','暖かい春の日にすべてのものが復活するかのように、喜びはあふれています。それはすべて熱くて暑いものなので、成功するためのガイドではありません。東に太陽があるので、そこにたどらないでください。あなたがその方向に作業を開始するので、しばらくそれを止めてください。','たくさんの仕事があるので忙しいです。私たちはこのドアを保管しているので、私たちは利益を得るために他の場所に行かなければなりません。ただし、忙しくて忙しい場合は、あまり失速しません。どこにでも富があるので、あなたは幸せで快適になります。良いことです。','世帯の中心は結果のようなものなので、私たちはすべての願いを満たして喜んでいます。明るい夜に美しい人に会います。家族が成長し、領土が増加するにつれて、家族は日々繁栄します。人のせいで良いことがあります。','両側は互いに組み合わされていたので、すべてのものが復活し、ペアになりました。プロパティとパワーは首に依存しているため、喜びは顔に広がっているので、隠すことはできません。どこにでも長さがあるので、この場所を移動したいと思います。仕事を終えるのは適切な運です。','道路の真ん中に、良いことがあります。役人は左に来るので、あなたは大きな富を得ることができます。あなたは祝福を満たすためだけに人々を扱わなければなりません。それは、Unfanesを集めて山になる方法です。','私はあなたに楽しんで笑うように言ったので、私はいつも口を覆うことはできません。試験に合格しない場合は、線形範囲が必要です。役人は西と南にいる必要があるので、それを宣伝して大胆に仕上げてください。','雲が出て雨が降ると、植生は浸されているので、すべてのものが活気があります。醜い真ん中に長い道のりがあるので、私は邪魔されません。カップルは調和がとれているので、喜びは家でいっぱいになります。これらすべてが意味し、善行をしたからです。','2025-03-02 11:57:41.395718+00','j');
